const initialState = {
  markdownAnalysisGraphData: {
    overall: {
      weekly_markdown: ['0.35', '0.35', '0.35', '0.35', '0.35', '0.3', '0.3', '0.3'],
      weekNum: [
        '2019-10-01',
        '2019-10-08',
        '2019-10-15',
        '2019-10-22',
        '2019-10-29',
        '2019-11-05',
        '2019-11-12',
        '2019-11-19',
      ],
      sellThrough: [
        356280.31,
        682920,
        995586.25,
        1319261.87,
        1651744.9900000002,
        1977072.0200000003,
        2294142.0200000005,
        2613964.3600000003,
      ],
      margin: [
        356280.31,
        682920,
        995586.25,
        1319261.87,
        1651744.9900000002,
        1977072.0200000003,
        2294142.0200000005,
        2613964.3600000003,
      ],
    },
  },
  analysisTabledata: [],
};

export default function (state = initialState, action) {
  switch (action.type) {
    case 'GET_MARKDOWNANALYSIS_GRAPH_DATA':
      return {
        ...state,
        markdownAnalysisGraphData: action.payload,
      };
    case 'SET_ANALYSIS_TABLE_DATA':
      return {
        ...state,
        analysisTabledata: action.payload,
      };
    default:
      return {
        ...state,
      };
  }
}
